PREFIX owl: <http://www.w3.org/2002/07/owl#>

ASK {
  <https://dblp.org/rec/journals/tnn/Liang01> dblp:authoredBy?x.
 ?y dblp:authoredBy?x.
  FILTER (?y!= <https://dblp.org/rec/journals/tnn/Liang01>).
 ?y dblp:publishedIn "GECCO".
  FILTER NOT EXISTS {
    <https://dblp.org/rec/journals/tnn/Liang01> dblp:publishedIn "GECCO".
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX foaf: <http://xmlns.com/foaf/0.1/>

ASK { <https://dblp.org/rec/conf/amcis/Bonner09> dblp:yearOfPublication '2009' }

ASK {
  <https://dblp.org/rec/conf/fpl/XiaFCTZJL17> <https://dblp.org/rdf/schema#authoredBy>?x.
  <https://dblp.org/rec/journals/tfs/Choi10> <https://dblp.org/rdf/schema#authoredBy>?x FILTER (?x!=?x) FILTER NOT EXISTS {
    <https://dblp.org/rec/conf/fpl/XiaFCTZJL17> <https://dblp.org/rdf/schema#authoredBy>?x.
    <https://dblp.org/rec/journals/tfs/Choi10> <https://dblp.org/rdf/schema#authoredBy>?x FILTER (?x!=?x)
  }
}

ASK {
 ?p1 <https://dblp.org/rdf/schema#authoredBy>?a.
 ?p2 <https://dblp.org/rdf/schema#authoredBy>?a.
  FILTER (?p1 = <https://dblp.org/rec/conf/iccv/Martin-BruallaG15> &&?p2 = <https://dblp.org/rec/journals/remotesensing/ZhengXZZYTL21> ||?p1 = <https://dblp.org/rec/conf/chi/ObristGBT08> &&?p2 = <https://dblp.org/rec/conf/icpads/Al-SadiDO02> ).
  FILTER NOT EXISTS {?p1 <https://dblp.org/rdf/schema#authoredBy>?a.?p2 <https://dblp.org/rdf/schema#authoredBy>?a. FILTER (?p1!=?p2 ) } }

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

ASK {?x dblp:authoredBy?y.?y dblp:publishedIn "CoRR" FILTER (?x!= <https://dblp.org/rec/journals/corr/abs-2003-04792>) }

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX schema: <http://schema.org/>
ASK {?x schema:author?y.?y schema:author?z.?z schema:author?w.?w schema:author?x FILTER (?w!=?x).?w schema:publishedIn?z FILTER NOT EXISTS {?x schema:publishedIn?z } }

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {?x <https://dblp.org/rdf/schema#authoredBy>?y.?y <https://dblp.org/rdf/schema#publishedIn> 'Fuzzy Sets Syst.' FILTER (?x!= <https://dblp.org/rec/journals/fss/GaoM22> && NOT(?x = <https://dblp.org/rec/journals/fss/SuQZ21>)) }

ASK {
 ?pub1 <https://dblp.org/rdf/schema#authoredBy>?author.
 ?pub1 <https://dblp.org/resource/uri>?pubUri.
 ?pub2 <https://dblp.org/rdf/schema#authoredBy>?author.
 ?pub2 <https://dblp.org/resource/uri>?pubUri.
  FILTER (?pub2!=?pub1).
  FILTER NOT EXISTS {
   ?pub1 <https://dblp.org/rdf/schema#authoredBy>?author.
   ?pub2 <https://dblp.org/rdf/schema#authoredBy>?author.
    FILTER (?pub2!=?pub1)
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX pid: <https://dblp.org/pid/>
ASK {?paper dblp:author?author FILTER NOT EXISTS {?paper dblp:author pid:60/404 } }

ASK {
 ?paper <https://dblp.org/rdf/schema#hasAuthor>?author.
 ?paper <https://dblp.org/rec/journals/expert/Swaby92>.
 ?author <https://dblp.org/rdf/schema#hasName> "Jonathan Hasenburg".
  FILTER NOT EXISTS {
   ?paper <https://dblp.org/rdf/schema#hasAuthor>?otherAuthor.
   ?otherAuthor <https://dblp.org/rdf/schema#hasName> "Jonathan Hasenburg"
  }
}

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {?paper <https://dblp.org/rdf/schema#yearOfPublication> '2014' FILTER NOT EXISTS {?paper <https://dblp.org/rec/conf/sdm/SugiyamaAGKB14> <https://dblp.org/rdf/schema#references>?paper } }

ASK {
 ?p1 <https://dblp.org/rdf/schema#author>?a.
 ?p1 <https://dblp.org/rdf/schema#hasPublication> <https://dblp.org/rec/journals/tvlsi/FangL014>.
 ?p2 <https://dblp.org/rdf/schema#author>?a.
 ?p2 <https://dblp.org/rdf/schema#hasPublication> <https://dblp.org/rec/conf/paap/LiS15>.
  FILTER (?p1!=?p2)
  FILTER NOT EXISTS {
   ?p1 <https://dblp.org/rdf/schema#author>?a.
   ?p2 <https://dblp.org/rdf/schema#author>?a.
    FILTER (?p1!=?p2)
  }
}

PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>
PREFIX dblp: <http://dblp.org/rdf/schema#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX xsd: <http://www.w3.org/2001/XMLSchema#>

ASK {?paper a dbpedia-owl:AcademicPaper ;
          dblp:publishedIn?conf ;
          dblp:year?year.
  FILTER(?year = 2019 &&?paper <https://dblp.org/rec/conf/clrimg/McElvainH07> ||?paper <https://dblp.org/rec/conf/eccv/GondalS018>) }

ASK {
 ?paper <https://dblp.org/rdf/schema#authoredBy>?author.
 ?author <https://dblp.org/rdf/schema#authored> <https://dblp.org/rec/journals/wicomm/KhoshrooWXK15>.
 ?paper <https://dblp.org/rdf/schema#publishedIn> 'Wirel. Commun. Mob. Comput.'.
  FILTER NOT EXISTS {?paper <https://dblp.org/rdf/schema#publishedIn> 'Wirel. Commun. Mob. Comput.' }
}

ASK {
 ?paper1 <https://dblp.org/rdf/schema#hasAuthor>?author.
 ?paper2 <https://dblp.org/rdf/schema#hasAuthor>?author.
  FILTER (?paper1 = <https://dblp.org/rec/journals/sensors/SuLTGK18> ||?paper1 = <https://dblp.org/rec/journals/access/KimYKSS18> ||?paper1 = <https://dblp.org/rec/journals/corr/abs-1303-0644>).
  FILTER (?paper2 = <https://dblp.org/rec/conf/fusion/GrossNS10>).
  FILTER (?paper1!=?paper2).
  FILTER NOT EXISTS {?paper1 <https://dblp.org/rdf/schema#hasAuthor>?author.?paper2 <https://dblp.org/rdf/schema#hasAuthor>?author FILTER (?paper1!=?paper2) }
}

ASK {
 ?paper1 <https://dblp.org/rdf/schema#hasAuthor>?author.
 ?paper2 <https://dblp.org/rdf/schema#hasAuthor>?author.
  FILTER (?paper1 = <https://dblp.org/rec/journals/corr/abs-1907-03955> ||?paper1 = <https://dblp.org/rec/journals/eswa/ShilaskarG13>).
  FILTER (?paper2 = <https://dblp.org/rec/conf/iccai/Zeng0RL021> ||?paper2 = <https://dblp.org/rec/journals/tii/LoweSYKGS18>).
  FILTER (?paper1!=?paper2).
  FILTER NOT EXISTS {
   ?paper1 <https://dblp.org/rdf/schema#hasAuthor>?author.
   ?paper2 <https://dblp.org/rdf/schema#hasAuthor>?author.
    FILTER (?paper1 =?paper2).
  }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>

ASK {
 ?pub a dblp:Publication.
 ?pub dblp:yearOfPublication "2019".
  FILTER NOT EXISTS {?pub dblp:yearOfPublication "2019".
                    ?pub dblp:uri <https://dblp.org/rec/journals/sensors/NavidNLDH19> }
}

ASK {
 ?paper <https://dblp.org/rdf/schema#hasAuthor>?author.
 ?paper <https://dblp.org/rdf/schema#title> "Learning to Copy for Automatic Post-Editing".
  FILTER NOT EXISTS {
   ?paper <https://dblp.org/rdf/schema#hasAuthor> <https://dblp.org/pid/54/9913>.
  }
}

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {?x <https://dblp.org/rdf/schema#authoredBy>?y.?y <https://dblp.org/rdf/schema#authoredBy> <https://dblp.org/rec/conf/dagstuhl/Arimoto94>.?y <https://dblp.org/rdf/schema#publishedIn> 'Parallel and Distributed Computing and Networks'. }

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {?paper1 dblp:authoredBy?author.?paper2 dblp:authoredBy?author. FILTER (?paper1!=?paper2 &&?paper1 = <https://dblp.org/rec/journals/jai/AugerBBZ09> &&?paper2 = <https://dblp.org/rec/journals/jai/LiD06> ) }

ASK {
 ?paper <https://dblp.org/rdf/schema#hasAuthor>?author.
 ?paper <https://dblp.org/rdf/schema#hasTitle> "A Real-Time Dispatching Strategy for Shared Automated Electric Vehicles with Performance Guarantees".
  FILTER NOT EXISTS {
   ?paper <https://dblp.org/rdf/schema#hasAuthor>?author2.
   ?author2 <https://dblp.org/rdf/schema#hasPublication> <https://dblp.org/rec/journals/symmetry/RofailY21>.
  }
}

ASK { 
  <https://dblp.org/rec/journals/jcisd/Galat08> <https://dblp.org/rdf/schema#author>?x. 
 ?x <https://dblp.org/rdf/schema#author>?y. 
 ?y <https://dblp.org/rdf/schema#author>?z. 
 ?z <https://dblp.org/rdf/schema#author>?w. 
 ?w <https://dblp.org/rdf/schema#author>?x FILTER (?x!=?y ) FILTER NOT EXISTS { 
    <https://dblp.org/rec/journals/jcisd/Galat08> <https://dblp.org/rdf/schema#author>?x. 
   ?x <https://dblp.org/rdf/schema#author>?y FILTER (?x!=?y ) } }

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>

ASK { <https://dblp.org/rec/journals/sensors/LiZL19> <https://dblp.org/rdf/schema#authoredBy>?x.?y <https://dblp.org/rdf/schema#authoredBy>?x FILTER (?y!= <https://dblp.org/rec/journals/sensors/LiZL19>).?y <https://dblp.org/rdf/schema#publishedIn> 'Sensors' }

ASK {
 ?pub1 a dbpedia:Publication ;
      dbpedia:author?author.
 ?pub2 a dbpedia:Publication ;
      dbpedia:author?author.
  FILTER (?pub1!=?pub2)
  FILTER NOT EXISTS {
   ?pub1 dbpedia:author?author.
   ?pub2 dbpedia:author?author.
  }
  FILTER NOT EXISTS {
   ?pub1 <https://dblp.org/rec/journals/talg/AnnamalaiKS17> <https://dblp.org/rdf/schema#authorOf>.
   ?pub2 <https://dblp.org/rec/conf/saci/PopescuGB11> <https://dblp.org/rdf/schema#authorOf>.
  }
  FILTER NOT EXISTS {
   ?pub1 <https://dblp.org/rec/conf/saci/PopescuGB11> <https://dblp.org/rdf/schema#authorOf>.
   ?pub2 <https://dblp.org/rec/journals/talg/AnnamalaiKS17> <https://dblp.org/rdf/schema#authorOf>.
  }
}

PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX dblp: <https://dblp.org/rdf/schema#>
ASK {?paper dblp:author?author.?paper dblp:publishedIn "IEEE International Conference on Data Mining" FILTER NOT EXISTS {?author dblp:published?paper }. FILTER NOT EXISTS {?author dblp:author <https://dblp.org/rec/conf/icdm/Zhang15> } }

ASK {
 ?paper <https://dblp.org/rdf/schema#authoredBy>?author.
 ?author <https://dblp.org/rdf/schema#authoredBy> <https://dblp.org/rec/journals/lgrs/SunWHZLZ22>.
 ?paper <https://dblp.org/rdf/schema#publishedIn>?journal.
  FILTER (?journal = 'IEEE Geosci. Remote. Sens. Lett.' ||?journal = 'Comput. Phys. Commun.' )
  FILTER NOT EXISTS {?paper <https://dblp.org/rdf/schema#publishedIn> 'IEEE Geosci. Remote. Sens. Lett.' }
}

PREFIX dblp: <https://dblp.org/rdf/schema#>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
ASK { <https://dblp.org/rec/journals/sensors/YapiciA17> <https://dblp.org/rdf/schema#authoredBy>?x.?y <https://dblp.org/rdf/schema#authoredBy>?x FILTER (?y!= <https://dblp.org/rec/journals/sensors/YapiciA17>).?y <https://dblp.org/rdf/schema#publishedIn> 'Sensors' }

