SELECT DISTINCT?author WHERE {
  { <https://dblp.org/rec/conf/mswim/DanoyBB15> <https://dblp.org/rdf/schema#author>?author } UNION
  { <https://dblp.org/rec/conf/imf/MokhovPD08> <https://dblp.org/rdf/schema#author>?author } UNION
  {?paper <https://dblp.org/rdf/schema#author>?author.
    FILTER(?paper = <https://dblp.org/rec/journals/tac/YangL18> ||?paper = <https://dblp.org/rec/journals/jac/YangL18>)
  }
