PREFIX dblp: <https://dblp.org/rdf/schema#>
SELECT DISTINCT?venue WHERE {
  { <https://dblp.org/rec/journals/tmm/YomaHB04> dblp:inProceedings?venue. }
  UNION
  { <https://dblp.org/rec/journals/isr/GhoshalMS15> dblp:inProceedings?venue. }
