  {?x dblp:inProceedings?venue.?x dblp:authoredBy <https://dblp.org/rec/journals/tmm/YomaHB04>. }
  UNION
  {?x dblp:inProceedings?venue.?x dblp:authoredBy <https://dblp.org/rec/journals/isr/GhoshalMS15>. }
}

SELECT (COUNT(DISTINCT?affiliation) AS?count) WHERE {
