  FILTER (?title = "Estonian Large Vocabulary Speech Recognition System for Radiology" ||?title = "L1 Covering Numbers for Uniformly Bounded Convex Functions").
 ?author <https://dblp.org/rdf/schema#affiliation>?affiliation.
}

