PREFIX dbpedia-owl: <http://dbpedia.org/ontology/>
PREFIX dblp: <http://dblp.org/rdf/schema#>
SELECT (COUNT(DISTINCT?author) AS?answer)
WHERE {
 ?publication a dblp:JournalArticle ;
               dblp:numberOfCreators?count.
  FILTER (?publication = <https://dblp.org/rec/journals/cvgip/ConnersTH84> ||?publication = <https://dblp.org/rec/conf/icip/AndreAB05> ||?publication = <https://dblp.org/rec/journals/siamam/KressR98> ).
 ?publication dblp:author?author.
  GROUP BY?publication
}

